package RepeatedStringMatch;

/**
 * Created by liutaotao on 2018/5/24.
 */
public class Solution {
    public int repeatedStringMatch(String A, String B) {
        if (A == B) return 1;
        String s = A;
        for (int i = 1; i <= 10000; i++) {
            if (s.contains(B)) return i;
            if (s.length() > B.length() * 2) break;
            s += A;
        }
        return -1;
    }

    public static void main(String[] args) {
        String A = "abcd", B = "cdabcdab";
//        String A = "abcd", B = "abcd";
//        String A = "abcabcabcabc", B = "abac";
//        String A = "";
//        String B = "";
        System.out.println(A.length() + " | " + B.length());
        System.out.println(A == B);
        Solution solution = new Solution();
        System.out.println(solution.repeatedStringMatch(A, B));
    }
}
